import React from 'react'

function MapTile(props) {
    return <div>0</div>
}

function MapRow(props) {
    return props.tiles.map(tile => <MapTile value={tile} />)
}

function Map(props) {
    return (
        <div 
            style={{
                width: '800px',
                height: '400px',
                backgroundColor: 'green',
                border: '4px solid white',  
            }}
        >
            {props.tiles.map(row => <MapRow tiles={row}/>)}
        </div>
    )
}

export default Map
